import{_ as i,a as e,b as r,c as l,d as a,e as t}from"./chunks/holybro_gps_dimensions.ILYW1v1q.js";import{_ as n,c as p,a8 as s,o as c}from"./chunks/framework.BDnHobkS.js";const N=JSON.parse('{"title":"Holybro M8N & M9N GPS","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/gps_holybro_m8n_m9n.md","filePath":"uk/gps_compass/gps_holybro_m8n_m9n.md"}'),h={name:"uk/gps_compass/gps_holybro_m8n_m9n.md"};function m(d,o,S,_,b,u){return c(),p("div",null,o[0]||(o[0]=[s('<h1 id="holybro-m8n-m9n-gps" tabindex="-1">Holybro M8N &amp; M9N GPS <a class="header-anchor" href="#holybro-m8n-m9n-gps" aria-label="Permalink to &quot;Holybro M8N &amp; M9N GPS&quot;">​</a></h1><p>GPS включає в себе модуль M8N або M9N UBLOX, компас IST8310, триколірний світлодіодний індикатор і запобіжний вимикач.</p><p>Існує 3 різних варіанти роз&#39;ємів, що дозволяють легко під&#39;єднуватися до польотних контролерів, сумісних зі стандартом роз&#39;єму Pixhawk, як до основного або додаткового GPS-приймача. Цей модуль поставляється зі швидкістю передачі даних 38400 Гц.</p><p>Основна відмінність між модулями полягає в тому, що M8N дозволяє одночасний прийом до 3 систем GNSS, тоді як M9N може одночасно підключатися до 4.</p><p><img src="'+i+'" width="200px" title="holybro_gps"> <img src="'+e+'" width="215px" title="holybro_gps"></p><h3 id="функціі-та-специфікаціі" tabindex="-1">Функції та специфікації <a class="header-anchor" href="#функціі-та-специфікаціі" aria-label="Permalink to &quot;Функції та специфікації&quot;">​</a></h3><ul><li>Модуль Ublox Neo-M8N або M9N</li><li>Найкраща в галузі навігаційна чутливість -167 дБм</li><li>Холодний запуск: 26 с</li><li>LNA MAX2659ELT+</li><li>25 x 25 x 4 мм керамічна патч-антена</li><li>Конденсатор Фараха, що перезаряджається</li><li>Малошумний стабілізатор 3,3 В</li><li>Струм споживання: менше 150 мА при 5 В</li><li>Фіксація індикаторних світлодіодів</li><li>Захисний чохол</li><li>У комплекті є кабель завдовжки 26 см</li><li>Діаметр: 50 мм загальний розмір, 32 грами з кейсом.</li><li><strong>M8N:</strong> Concurrent reception of up to 3 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li><strong>M9N:</strong> Concurrent reception of up to 4 GNSS (GPS, Galileo, GLONASS, BeiDou)</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="https://holybro.com/collections/gps" target="_blank" rel="noreferrer">Holybro</a></li></ul><p>Зверніть увагу, що існують варіанти як для M8N, так і для M9N, а також три різні роз&#39;єми.</p><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p>GPS-модулі M8N і M9N випускаються в трьох варіантах. Вони дозволяють підключатись до польотних контролерів, які відповідають стандарту роз&#39;єму Pixhawk, як основний або додатковий GPS.</p><ul><li><p><strong>SKU12012 Holybro M8N GPS (JST GHR1.25mm 10 pin cable)</strong>.</p><p>This JST GH 10Pin connector can be used on Pixhawk Series 10pin <code>GPS Module</code> or <code>GPS1</code> input port.</p><p><img src="'+r+'" alt="Holybro M8N with Pixhawk GPS1 connector"></p></li><li><p><strong>SKU12014 Holybro M8N 2nd GPS (JST GHR1.25m m 6pin cable)</strong></p><p>This JST GH 6Pin connector can be used on Pixhawk Series 6pin <code>UART</code>, <code>I2C</code> or <code>GPS2</code> input port as secondary GPS.</p><p><img src="'+l+'" alt="Holybro M8N with Pixhawk 2nd GPS connector"></p></li><li><p><strong>SKU12013 Holybro M8N GPS for Pix32 (Molex 1.25mm 6pin &amp; 4pin &amp; 3pin cable)</strong></p><p>These Molex 1.25mm 6pin &amp; 4pin &amp; 3pin connectors are for the <a href="./../flight_controller/holybro_pix32.html">Holybro pix32 Flight Controller</a> <code>Switch</code>, <code>GPS</code>, and <code>I2C</code> input ports (not for the Pix32 v5 or v6).</p><p><img src="'+a+'" alt="Holybro M8N with Pix32 connector"></p></li></ul><h2 id="розміри" tabindex="-1">Розміри <a class="header-anchor" href="#розміри" aria-label="Permalink to &quot;Розміри&quot;">​</a></h2><p><img src="'+t+'" alt="Image showing dimensions of both modules"></p>',15)]))}const G=n(h,[["render",m]]);export{N as __pageData,G as default};
